script: |
  super -f text -I q10953.spq | sort > q10953.out

inputs:
  - name: q10953.spq
    data: |
      SELECT DISTINCT + col0 FROM tab1 (FORMAT parquet) WHERE NOT - 54 IN ( col0 - 64, - col1 * - col2 * - 48 * + col2 + - col1, + ( - col1 ) + + 95 + - - col2, - col2 );
  - name: tab1

outputs:
  - name: q10953.out
    data: |
      51
      85
      91
